import React from 'react'
import './navbar.css'

function Navbar() {
   const logout = () => {
     localStorage.removeItem('token');
     window.open("http://localhost:5000/auth/logout", "_self");
   };
   const dashboard = () => {
     window.open(`http://localhost:3000/dashboard/${user.googleId}`, "_self");
